        text1: 'red',
        text2: 'grey',
        text3: 'black',
    },
    titles: {
        title1: 50,
        btntxt: 20,
    },
    btn1:{
        width: '80%',
        height: 50,
        backgroundColor: 'red',
        borderRadius: 10,
        marginVertical:10,
        alignItems: 'center',
        justifyContent: 'center',
        //elevation:10, //only android
        boxShadow: '2px 2px 10px #888888', //web use
        color: 'white',
    },
    hr80:{
        width: '80%',
        borderBottomColor: '#E0E0E0',
        borderBottomWidth: 1,
        marginVertical: 20,
    },
    veg: {
        backgroundColor: 'green',
